import React from "react";
import Navbar from "../Component/Navbar";
import { DataGrid } from "@mui/x-data-grid";
import Paper from "@mui/material/Paper";
export default function Home() {
  const columns = [
    { field: "id", headerName: "ID", width: 70 },
    { field: "Username", headerName: "Username", width: 130 },
    { field: "ประเภทเงินเดือน", headerName: "ประเภทเงินเดือน (เงิ)", width: 130 },
    {
      field: "age",
      headerName: "Age",
      type: "number",
      width: 90,
    },
    {
      field: "fullName",
      headerName: "Full name",
      description: "This column has a value getter and is not sortable.",
      sortable: false,
      width: 160,
      valueGetter: (value, row) =>
        `${row.firstName || ""} ${row.lastName || ""}`,
    },
  ];

  const rows = [
    { id: 1, lastName: "Snow", firstName: "Jon", age: 35 },
    { id: 2, lastName: "Lannister", firstName: "Cersei", age: 42 },
    { id: 3, lastName: "Lannister", firstName: "Jaime", age: 45 },
    { id: 4, lastName: "Stark", firstName: "Arya", age: 16 },
    { id: 5, lastName: "Targaryen", firstName: "Daenerys", age: null },
    { id: 6, lastName: "Melisandre", firstName: null, age: 150 },
    { id: 7, lastName: "Clifford", firstName: "Ferrara", age: 44 },
    { id: 8, lastName: "Frances", firstName: "Rossini", age: 36 },
    { id: 9, lastName: "Roxie", firstName: "Harvey", age: 65 },
  ];

  const paginationModel = { page: 0, pageSize: 5 };

  return (
    <div className="w-full h-screen bg-gradient-to-r from-black via-green-900 to-black">
      <Navbar />
      <div className="w-full h-20 flex justify-between text-white items-center">
        <div className="w-[50%] text-center">
          <button className="TITLENAV" data-text="Awesome">
            <span className="actual-text poppins-bold">
              &nbsp;USERALL&nbsp;
            </span>
            <span aria-hidden="true" className="hover-text poppins-bold">
              &nbsp;USERALL&nbsp;
            </span>
          </button>
        </div>
        <div className="w-[50%]"></div>
      </div>
      <div className="w-full h-[70%] flex items-center justify-center">
        <div className="w-[80%] h-[100%] bg-black/40 flex items-center">
          <Paper sx={{ height: 400, width: "100%" }}>
            <DataGrid
              rows={rows}
              columns={columns}
              initialState={{ pagination: { paginationModel } }}
              pageSizeOptions={[5, 10]}
              checkboxSelection
              sx={{ border: 0 }}
            />
          </Paper>
        </div>
      </div>
    </div>
  );
}
